import '../styles/App.scss';
import callToApi from '../services/callToApi';
import { useState, useEffect } from 'react';


const App = () => {
  const [products, setProducts]= useState([]);
  useEffect(() => {
    callToApi().then((data) => setProducts(data));
  }, []);



  return <div>Hola mundo</div>;
};

export default App;
